pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/introspection/IERC165.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./TradeableAndBankable.sol";
import "../../../interfaces/ITokenCertified.sol";
import "../../../interfaces/ITokenEquivalent.sol";
import "../../../interfaces/IPackedToken.sol";
import "../../../interfaces/ITokenWithId.sol";

library Token {
    /*enum Type {
        Unknown,
        Cur,
        Erc20,
        Max
    }*/
    bytes32 constant public CURRENCY = 0xad3228b676f7d3cd4284a5443f17f1962b36e491b30a40b2405849e597ba5fb5;

    uint64 constant TypeMask =                  0xff;    // is TypeCurrency
    uint64 constant TypeCurrency =              0x1;    // is TypeCurrency
    uint64 constant TypeERC20 =                 0x2;    // is Test

    uint64 constant isTokenWithId =          0x100;    // Contract needs tokenId
    uint64 constant SupportERC165 =          0x200;    // Supports IERC265
    //uint64 constant SupportERC20 =           0x400;    // Supports IERC20
    uint64 constant SupportTradeable =       0x800;    // Supports ITradeable

    uint64 constant SupportTokenCertified =  0x1000;    // Supports ITokenEquivalent
    uint64 constant SupportTokenEquivalent = 0x2000;   // Supports ITokenEquivalent
    uint64 constant SupportPackedToken =     0x4000;   // Supports IPackedToken
    uint64 constant SupportTokenWithId =     0x8000;   // Supports ITokenWithId

    struct Info {
        //Type tokentype;
        int8 granularity;
        bool nft;
        uint64 features;
    }

    function granularity(Info memory info_) public pure returns (uint256) {
        if (info_.features==0)
            return 0;
        return 10**(uint8(18 + info_.granularity));
    }
    function tokenInfo(address tokenaddress_)
        public
        view
        returns (Info memory info_)
    {
        return tokenInfo(tokenaddress_,0,false);
    }
    function tokenInfo(address tokenaddress_, bool canfail_)
        public
        view
        returns (Info memory info_)
    {
        return tokenInfo(tokenaddress_,0,canfail_);
    }
    function tokenInfo(address tokenaddress_,uint256 tokenid_)
        public
        view
        returns (Info memory info_)
    {
        return tokenInfo(tokenaddress_,tokenid_,false);
    }
    function tokenInfo(address tokenaddress_,uint256 tokenid_, bool canfail_)
        public
        view
        returns (Info memory info_)
    {
        info_=tokenInfoEx(tokenaddress_,0,info_,canfail_);
        if (info_.features & isTokenWithId != 0)
            info_=tokenInfoEx(tokenaddress_,tokenid_,info_,canfail_);

    }
    function tokenInfoEx(address tokenaddress_,uint256 tokenid_, Info memory infoin_, bool canfail_)
        public
        view
        returns (Info memory info_)
    {
        if (tokenid_==0)
        while (true) {
            info_.granularity = -18;
            if (tokenaddress_ == address(0)) {
                info_.features = TypeCurrency;
                break;
            }
            try IERC165(tokenaddress_).supportsInterface(type(IERC165).interfaceId) {
                info_.features |= SupportERC165;
            } catch {}
            if (info_.features & SupportERC165 != 0) {
                if (IERC165(tokenaddress_).supportsInterface(type(IERC20).interfaceId))
                    info_.features |= TypeERC20;
                if (
                    IERC165(tokenaddress_).supportsInterface(
                        type(ITradeable).interfaceId
                    )
                ) info_.features |= SupportTradeable;
                if (
                    IERC165(tokenaddress_).supportsInterface(
                        type(ITokenCertified).interfaceId
                    )
                ) info_.features |= SupportTokenCertified;
                if (
                    IERC165(tokenaddress_).supportsInterface(
                        type(ITokenEquivalent).interfaceId
                    )
                ) info_.features |= SupportTokenEquivalent;
                if (
                    IERC165(tokenaddress_).supportsInterface(
                        type(IPackedToken).interfaceId
                    )
                ) info_.features |= SupportPackedToken;
                if (
                    IERC165(tokenaddress_).supportsInterface(
                        type(ITokenWithId).interfaceId
                    )
                ) info_.features |= SupportTokenWithId|isTokenWithId;
            } else {
                try IERC20(tokenaddress_).totalSupply() {
                    info_.features |= TypeERC20;
                } catch {}
            }
            if (info_.features&TypeMask==0&&canfail_) 
                require(false, "Unresolved token type");
            break;
        }
        else
        {
            info_ = infoin_;
        }
    }
}
